import React from 'react'
import img1 from './logo512.png';
export default function elementPost() {
    return (
        postData.map((value, key) => {
            return (
                <div key={key} className='mb-4 col'>
                    <a style={{ cursor: 'pointer' }} className='card text-decoration-none'>
                        <img src={img1} className="card-img-top" alt="..." />
                        <div className="card-body">
                            <h5 style={{ color: 'black' }} className="card-title">Card title</h5>
                            <p style={{ color: 'black' }} className="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
                        </div>
                    </a>
                </div>
            )
        })
    )
}
